        hProcess = OpenProcess(PROCESS_ALL_ACCESS, FALSE, pId);
        if (hProcess == NULL)
        {
            _tprintf(_T("[-] Could not open process. LastError = %d\n"), GetLastError());
            __leave;
        }

        // Calculate the size of the DLL path
        dwSize = (lstrlenA(dllPath) + 1) * sizeof(char);

        // Allocate space in the remote process for the DLL path
        remoteDll = VirtualAllocEx(hProcess, NULL, dwSize, MEM_COMMIT, PAGE_READWRITE);
        if (remoteDll == NULL)
        {
            _tprintf(_T("[-] VirtualAllocEx() failed. LastError = %d\n"), GetLastError());
            __leave;
        }

        // Copy the DLL path to the remote process
        if (!WriteProcessMemory(hProcess, remoteDll, (LPVOID)dllPath, dwSize, NULL))
        {
            _tprintf(_T("[-] WriteProcessMemory() failed. LastError = %d\n"), GetLastError());
            __leave;
        }

        // Get the real address of LoadLibraryA()
        hinstDLL = LoadLibrary(_T("kernel32.dll"));
        if (hinstDLL == NULL)
        {
            _tprintf(_T("[-] LoadLibrary() failed. LastError = %d\n"), GetLastError());
            __leave;
        }

        // Get the address of LoadLibraryA()
        FARPROC proc = GetProcAddress(hinstDLL, "LoadLibraryA");
        if (proc == NULL)
        {
            _tprintf(_T("[-] GetProcAddress() failed. LastError = %d\n"), GetLastError());
            __leave;
        }

        // Create a remote thread that calls LoadLibraryA(DLLPath)
        hThread = CreateRemoteThread(hProcess, NULL, 0, (LPTHREAD_START_ROUTINE)proc, remoteDll, 0, &threadId);
        if (hThread == NULL)
        {
            _tprintf(_T("[-] CreateRemoteThread() failed. LastError = %d\n"), GetLastError());
            __leave;
        }

        // Wait for the remote thread to terminate
        WaitForSingleObject(hThread, INFINITE);

        result = TRUE;
    }
    __finally
    {
        // Cleanup
        if (hThread)
            CloseHandle(hThread);

        if (hProcess)
            CloseHandle(hProcess);

        if (remoteDll)
            VirtualFreeEx(hProcess, remoteDll, 0, MEM_RELEASE);
    }

    return result;
}

